import React from 'react';
import SearchBar from '../components/searchbar';
import MovieGallery from '../components/moviegallery';
import { Container } from 'react-bootstrap';

const Search = () => {
    return (
      <>
        <Container>
          <SearchBar />
          <MovieGallery />
        </Container>
      </>
    );
}

export default Search;
